        /* animation - velocity for speed */
        var velbase = {}
        switch (pJS.particles.move.direction) {
            case 'top':
                velbase = {x: 0, y: -1};
                break;
            case 'top-right':
                velbase = {x: 0.5, y: -0.5};
                break;
            case 'right':
                velbase = {x: 1, y: -0};
                break;
            case 'bottom-right':
                velbase = {x: 0.5, y: 0.5};
                break;
            case 'bottom':
                velbase = {x: 0, y: 1};
                break;
            case 'bottom-left':
                velbase = {x: -0.5, y: 1};
                break;
            case 'left':
                velbase = {x: -1, y: 0};
                break;
            case 'top-left':
                velbase = {x: -0.5, y: -0.5};
                break;
            default:
                velbase = {x: 0, y: 0};
                break;
        }

        if (pJS.particles.move.straight) {
            this.vx = velbase.x;
            this.vy = velbase.y;
            if (pJS.particles.move.random) {
                this.vx = this.vx * (Math.random());
                this.vy = this.vy * (Math.random());
            }
        } else {
            this.vx = velbase.x + Math.random() - 0.5;
            this.vy = velbase.y + Math.random() - 0.5;
        }

        // var theta = 2.0 * Math.PI * Math.random();
        // this.vx = Math.cos(theta);
        // this.vy = Math.sin(theta);

        this.vx_i = this.vx;
        this.vy_i = this.vy;


